window.bookSummaryJSON = "<p>In a world full of superheroes, be a power gamer.</p> <p>Everyone has a superpower, even Sam. The thing is, Sam has a power unlike anyone else. He can level up.</p> <p>That might not seem like much, but when everything from doing dishes to thwarting robberies gains you experience, Sam has finally found a way to become the most powerful hero the world has ever seen.</p> <p>And it’s a good thing, too, because the world’s most powerful villain has come back from beyond the grave, and if death didn't stop him, what can anyone else do to stop him?&nbsp;</p> <p>And Sam? Well, he doesn’t stand a chance right now, either, but if he can level up just a bit more...anything is possible.</p> <p><b>Warning: </b>This book contains awesome superpowers, sexy women, sex scenes, explosions, crazy power leveling, and the ability to become the strongest person the universe has ever seen. That’s right, we said universe.</p>"; 
